import axios from "axios"

export function loadClients(size, page, sort, order){
  return axios({
    method:"get",
    url:"/api/private/clients",
    params:{
      size, page, sort, order
    }
  }).then(response=>{
    return response.data
  }).catch(()=>{
    return false
  })
}

export function createNewClinet(newClient){
  return axios({
    method:"post",
    url:"/api/private/clients",
    data:newClient
  }).then(response=>{
    return response.data
  }).catch(()=>{
    return false
  })
}
